import { useState } from "react";

function MyCounter(){
    const [count, incCount] = useState(0);
    
    function clickCounter(){
        incCount(count + 1);
    }

    return(
        <div >
            <button onClick={clickCounter}>{count}</button>
        </div>
    )

}

export default MyCounter
